import styled from "@emotion/styled";

export const FriendListWrapper = styled.div`
    width: 100%;
    height: 9em;
    margin-top: 1em;
    box-shadow: 0 0 10px #181818;
    padding: .5em;
    display: flex;
    img {
        width: 6em;
        border-radius: .8em;
        object-fit: cover;
    }
    h1 {
        margin-left: .5em;
    }
    :first-child {
        margin: 0;
    }
`
